import { Button, Typography, Box } from "@mui/material";
import React from "react";
import wallpaper from '../Assets/homepageimg.png'
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div>
      <div>
      <img src={wallpaper} width='100%' height='450' />


      </div>
      
    </div>
  );
};

export default Home;
